function unique(arqw) {
        var a = [], i, j
        outer: for (i = 0; i < arqw.length; i++) {
                for (j = 0; j < a.length; j++) {
                        if (a[j] == arqw[i]) {
                                continue outer
                        }
                }
                a[a.length] = arqw[i]
        }
        return a
}


